import React, { Component } from 'react';
import './App.css';
import { dropdownbar } from './components/input-type.js'

class App extends Component {
  state = {users: []}

  componentDidMount() {
    fetch('/users')
      .then(res => res.json())
      .then(users => this.setState({ users }))
  }

  render() {
    return (
      <div className="App">
        < dropdownbar />
      </div>
    )
  }
}

export default App;
